import { StyleSheet, View } from "react-native";
import CategoriesScreen from "./src/screens/CategoriesScreen";

export default function App() {
    return (
        <View style={styles.container}>
            <CategoriesScreen />
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        padding: 20,
    },
});
